// Import necessary modules
import React from "react";
import ReactDOM from "react-dom";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import App from "./App"; // Import your root component

// Define your theme configuration
const theme = createTheme({
  palette: {
    primary: {
      main: "#ff00ff", // Adjust the primary color as needed
    },
    secondary: {
      main: "#00ffff", // Adjust the secondary color as needed
    },
  },
});

// Render your root component wrapped in ThemeProvider
ReactDOM.render(
  <React.StrictMode>
    <ThemeProvider theme={theme}>
      <App />
    </ThemeProvider>
  </React.StrictMode>,
  document.getElementById("root")
);
